// src/components/Team.jsx

import React from 'react';

const Team = ({ team }) => {
  return (
    <div>
      <h3>Your Pok√©mon Team</h3>
      <div style={{ display: 'flex', gap: '1rem' }}>
        {team.map((pokemon) => (
          <div key={pokemon.id} style={{ textAlign: 'center' }}>
            <img src={pokemon.image} alt={pokemon.name} width={100} />
            <p>{pokemon.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Team;
